import React from 'react';
import burgerLogo from './../../assets/Images/burger-logo.png'
import classes from './Logo.module.css'

const Logo = (props) => (
    <div className={classes.Logo}>
        <img src={burgerLogo} alt="MyBurger" style={{ height: props.height }} />
    </div>
);

export default Logo;
